import React, { useState } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Container,
  Tabs,
  Tab,
  Box,
  Button
} from '@mui/material';
import Annotations from './components/Annotations';
import Labels from './components/Labels';
import Search from './components/Search';
import RemoveLabels from './components/RemoveLabels';
import MergeLabels from './components/MergeLabels';
import RenameLabels from './components/RenameLabels';

function App() {
  const [jsonData, setJsonData] = useState(null);
  const [modifiedJson, setModifiedJson] = useState(null);
  const [tabIndex, setTabIndex] = useState(0);

  const handleFileUpload = (e) => {
    const file = e.target.files[0];
    if (!file) return;
    const reader = new FileReader();
    reader.onload = (event) => {
      try {
        const uploadedData = JSON.parse(event.target.result);
        setJsonData(uploadedData);
        setModifiedJson(uploadedData); // Initialize modified JSON as the uploaded JSON
        console.log('Uploaded JSON:', uploadedData); // Log the uploaded JSON
      } catch (error) {
        console.error('Error parsing JSON:', error);
      }
    };
    reader.readAsText(file);
  };

  const handleTabChange = (event, newValue) => {
    setTabIndex(newValue);
  };

  const downloadModifiedJson = () => {
    const dataStr = JSON.stringify(modifiedJson, null, 2);
    const dataBlob = new Blob([dataStr], { type: 'application/json' });
    const url = URL.createObjectURL(dataBlob);
    const link = document.createElement('a');
    link.href = url;
    link.download = 'modified_annotations.json';
    link.click();
  };

  return (
    <>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6">COCO Annotation Management</Typography>
        </Toolbar>
      </AppBar>
      <Container maxWidth="lg">
        <Box my={4}>
          <input type="file" accept=".json" onChange={handleFileUpload} />
          {jsonData && (
            <Typography variant="body1" sx={{ mt: 2 }}>
              JSON file uploaded and ready for processing.
            </Typography>
          )}
        </Box>

        {modifiedJson && (
          <>
            <Tabs
              value={tabIndex}
              onChange={handleTabChange}
              indicatorColor="primary"
              textColor="primary"
              variant="scrollable"
              scrollButtons="auto"
              sx={{ borderBottom: 1, borderColor: 'divider' }}
            >
              <Tab label="View Annotations" />
              <Tab label="View Labels" />
              <Tab label="Search Labels" />
              <Tab label="Remove Labels" />
              <Tab label="Merge Labels" />
              <Tab label="Rename Labels" />
            </Tabs>

            <TabPanel value={tabIndex} index={0}>
              <Annotations jsonData={modifiedJson} />
            </TabPanel>
            <TabPanel value={tabIndex} index={1}>
              <Labels jsonData={modifiedJson} />
            </TabPanel>
            <TabPanel value={tabIndex} index={2}>
              <Search jsonData={modifiedJson} />
            </TabPanel>
            <TabPanel value={tabIndex} index={3}>
              <RemoveLabels jsonData={modifiedJson} setJsonData={setModifiedJson} />
            </TabPanel>
            <TabPanel value={tabIndex} index={4}>
              <MergeLabels jsonData={modifiedJson} setJsonData={setModifiedJson} />
            </TabPanel>
            <TabPanel value={tabIndex} index={5}>
              <RenameLabels jsonData={modifiedJson} setJsonData={setModifiedJson} />
            </TabPanel>

            <Box mt={3}>
              <Button variant="contained" color="secondary" onClick={downloadModifiedJson}>
                Download Modified JSON
              </Button>
            </Box>
          </>
        )}
      </Container>
    </>
  );
}

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`full-width-tabpanel-${index}`}
      {...other}
    >
      {value === index && <Box py={3}>{children}</Box>}
    </div>
  );
}

export default App;
